window.bookSummaryJSON = "<p>An academy that scrapes the sky. Blight that fills the earth. Two codgers duking it out.</p> <p>Artorian has decided to live, all in order to save his lost village children. His recent battle against a simple raider captain has proven that if he tries to charge ahead...he'll die.</p> <p>With the help of his captors, who quickly turn into close friends, Artorian takes the first steps onto the path of a true cultivator. Finesse, skill, fine-tuned cultivation techniques, and more is within his grasp. Artorian is more than willing to learn; after all, that's his specialty!</p> <p>This knowledge has strings attached. After meeting the ancient enemy of his trainers, Artorian returns to the place he first studied his true passion of philosophy: the Skyspear. It's under new management, and the alumni have very different ideas about how the students should be trained.</p>"; 
